import React from 'react';

import { ContactPageContainer } from './contact.styles';

const ContactPage = () => (
    <ContactPageContainer>
        <i className="fa">&#xf09b;</i>
        <i className="fa">&#xf099;</i>
        <i className="fa">&#xf08c;</i>
        <i className="material-icons">&#xe0be;</i>
        <i className="material-icons">&#xe30a;</i>
    </ContactPageContainer>
);

export default ContactPage;
